drop table if exists C_SSB_PRJ_GRP;
drop table if exists TBL_PROJECT;
drop table if exists MVN_RPSTY;

create table C_SSB_PRJ_GRP (
  PRJ_GRP_ID varchar(20) not null,
  PRJ_GRP_NAME varchar(100) not null
);

create table TBL_PROJECT (
  REQID INT not null,
  REQUEST_NAME varchar(500) not null,
  REQUEST_STATUS varchar(50),
  CATEGORY varchar(50)
);

create table MVN_RPSTY(
	seqId identity,
	groupId varchar(100) not null,
	artifactId varchar(50) not null,
	version varchar(30) not null,
	optional boolean,
	scope varchar(15)
);





